import React, { useState } from "react";
import { motion, AnimatePresence } from "framer-motion";
import { FaPlus, FaMinus } from "react-icons/fa";

// Service Data (unchanged)
const services = [
  {
    title: "Mobile App Development",
    description:
      "I specialize in crafting high-performance, cross-platform mobile applications using React Native, Swift, and Kotlin. My work focuses on delivering scalable, user-friendly apps tailored to client needs. Recent projects include an EV charging app with real-time station tracking and a fintech wallet with secure payment features.",
    image: null,
  },
  {
    title: "API Integration",
    description:
      "I seamlessly integrate REST APIs and GraphQL into mobile apps to enable robust data flow and advanced functionality. My experience includes connecting apps to Firebase for real-time databases, implementing Stripe for payments, and building custom backend solutions to enhance app performance and reliability.",
    image: null,
  },
  {
    title: "UI/UX Optimization",
    description:
      "I enhance user experiences by designing intuitive, responsive interfaces and optimizing app performance for both iOS and Android platforms. Using tools like TailwindCSS and Redux, I ensure smooth navigation and visually appealing designs. Examples include optimizing checkout flows for e-commerce apps and improving accessibility in fintech solutions.",
    image: null,
  },
  {
    title: "Freelance Consulting",
    description:
      "As a freelance mobile developer with 3 years of experience, I provide end-to-end solutions—from ideation and prototyping to deployment and maintenance. I’ve worked with startups and businesses to deliver MVPs, integrate third-party services like biometric authentication, and offer ongoing support to ensure app success in competitive markets.",
    image: null,
  },
];

// Animation Variants
const cardVariants = {
  hidden: { opacity: 0, height: 0, y: 20 },
  visible: {
    opacity: 1,
    height: "auto",
    y: 0,
    transition: { duration: 0.5, ease: [0.4, 0, 0.2, 1], when: "beforeChildren", staggerChildren: 0.1 },
  },
  exit: { opacity: 0, height: 0, transition: { duration: 0.3, ease: "easeIn" } },
};

const childVariants = {
  hidden: { opacity: 0, y: 15 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.4 } },
};

export default function Services() {
  const [expanded, setExpanded] = useState(null);

  const toggleExpand = (index) => {
    setExpanded(expanded === index ? null : index);
  };

  return (
    <section className="py-20 md:py-32 px-4 sm:px-6 lg:px-8 bg-gradient-to-br from-gray-50 via-white to-gray-100">
      <div className="max-w-6xl mx-auto">
        <motion.div
          className="text-center mb-20"
          initial={{ opacity: 0, y: -30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, ease: [0.2, 0, 0, 1] }}
        >
          <h2 className="text-lg md:text-xl text-green-600 uppercase tracking-widest font-semibold bg-green-100/50 inline-block px-4 py-1 rounded-full">
            Services
          </h2>
          <h1 className="text-4xl md:text-5xl lg:text-6xl font-bold text-gray-900 mt-4 tracking-tight bg-gradient-to-r from-gray-900 to-gray-700 bg-clip-text text-transparent">
            My Expertise
          </h1>
          <p className="mt-6 text-gray-600 max-w-3xl mx-auto text-lg md:text-xl leading-relaxed font-light">
            Crafting innovative mobile solutions with a focus on performance, usability, and client success.
          </p>
        </motion.div>

        <div className="space-y-6">
          {services.map((service, index) => (
            <motion.div
              key={index}
              className={`relative bg-white rounded-2xl shadow-md hover:shadow-xl transition-all duration-300 overflow-hidden border border-gray-100/50 ${
                expanded === index ? "ring-2 ring-green-200" : ""
              }`}
              initial={false}
              whileHover={{ y: -5, boxShadow: "0 15px 30px rgba(0,0,0,0.1)" }}
            >
              {/* Subtle gradient overlay */}
              <div className="absolute inset-0 bg-gradient-to-r from-green-50/0 via-green-50/20 to-green-50/0 pointer-events-none" />

              <div
                className="flex justify-between items-center cursor-pointer px-6 md:px-8 py-6 group relative z-10"
                onClick={() => toggleExpand(index)}
              >
                <h3
                  className={`text-xl md:text-2xl lg:text-3xl font-semibold text-gray-800 group-hover:text-green-600 transition-colors duration-300 ${
                    expanded === index ? "text-green-600" : ""
                  }`}
                >
                  {service.title}
                </h3>
                <motion.span
                  className="p-2 bg-gray-100 rounded-full text-gray-600 group-hover:text-green-600 group-hover:bg-green-50 transition-all duration-300"
                  animate={{ rotate: expanded === index ? 180 : 0 }}
                  transition={{ duration: 0.4 }}
                >
                  {expanded === index ? <FaMinus size={20} /> : <FaPlus size={20} />}
                </motion.span>
              </div>

              <AnimatePresence>
                {expanded === index && (
                  <motion.div
                    className="px-6 md:px-8 pb-8 text-gray-700"
                    variants={cardVariants}
                    initial="hidden"
                    animate="visible"
                    exit="exit"
                  >
                    <div className="flex flex-col md:flex-row gap-8">
                      {service.image && (
                        <motion.img
                          src={service.image}
                          alt={`${service.title} example`}
                          className="w-40 md:w-56 rounded-lg shadow-lg object-cover border border-gray-100"
                          variants={childVariants}
                        />
                      )}
                      <motion.div className="space-y-6" variants={childVariants}>
                        <p className="text-base md:text-lg leading-relaxed font-light text-gray-600">
                          {service.description}
                        </p>
                        <a
                          href="/contact"
                          className="inline-flex items-center gap-3 px-6 py-2 bg-green-600 text-white rounded-full hover:bg-green-700 transition-all duration-300 group shadow-md hover:shadow-lg"
                        >
                          Explore More
                          <motion.span
                            className="group-hover:translate-x-1 transition-transform duration-300"
                          >
                            <FaPlus size={14} />
                          </motion.span>
                        </a>
                      </motion.div>
                    </div>
                  </motion.div>
                )}
              </AnimatePresence>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}
